import { StyleSheet, Text, View, Image } from 'react-native'
import React from 'react'
import ImageAvatar from '../components/ImageAvatar'

const UserCard = () => {
  return (
    <View style={styles.container}>
        <View style={styles.wrapper}>
            <View style={styles.left}>
                <ImageAvatar size={24} src={require('../assets/avater.png')}/>
                <Text style={styles.name}>Shapon Pal</Text>
            </View>
            <View style={styles.right}>
                <Text>R</Text>
            </View>
        </View>
        
        <View style={{}}>
            
            <Image size={24} source={require('../assets/avater.png')} />
        </View>
      </View>
  )
}

export default UserCard

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#F7F7F7',
        borderRadius: 8,
        margin: 5,
        padding: 10
    },
    wrapper: {
        display: 'flex',
        flexDirection: 'row',
        justifyContent: "space-between",
        alignItems: "center",
    },
    left:{
        display: 'flex',
        flexDirection: 'row',

    },
    right: {
        display: 'flex',
        flexDirection: 'row',
    },
    name:{
        fontSize: 18,
        lineHeight: 22,
        fontWeight: '500',
        color: '#1B1A57'
    }
})
